import logo from './logo.svg';
import './App.css';
import ListQuotes from './js/listquotes';
import InsertWriter from './js/insertwriter';
import { BrowserRouter, Router, Route } from 'react-router-dom'

function App() {
  return (
 /*   <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>*/
    <Router>
      <div className="main">
        <div>  
          <Route exact path='/insertwriter' component={InsertWriter} />
        </div>
        <div style={{ marginTop: 20 }}>
          <Route exact path='/listquotes' component={ListQuotes} />
        </div>
        <Route path='/' component={ListQuotes} />
        </div>
      </Router>
  );
}

//ReactDOM.render(<App />, document.getElementById('monapp'));


export default App;
